import os
import sys
import numpy as np
import platform
import timeit
from os import listdir
from tensorflow.keras.preprocessing.text import Tokenizer 
from tensorflow.keras.preprocessing.sequence import pad_sequences
from tensorflow.keras.utils import to_categorical
from tensorflow.keras.layers import Dense, Input, GlobalMaxPooling1D
from tensorflow.keras.layers import Conv1D, MaxPooling1D, Embedding
from tensorflow.keras.initializers import Constant
from tensorflow.keras.models import Model

"""# Globals"""

limit = None
embeddings_dir = './'
text_benchmark_data_dir = './20_newsgroup'
max_num_words = 20000
max_sequence_length = 1000
loss_func = 'categorical_crossentropy'

validation_split = 0.2
embedding_dim = 200
n_classes = 2

"""# All Datasets and Embeddings Downloads"""

start_time = timeit.default_timer()
OS = platform.system()  

from google.colab import drive
drive.mount('/content/gdrive')

if not os.path.exists("./glove.6B.200d.zip"):
  os.system('cp -p "/content/gdrive/MyDrive/Datasets/glove.6B.200d.zip" "./"')
  if OS == "Linux":
    os.system('unzip -o -n "./glove.6B.200d.zip" -d "./"')
if not os.path.exists("./20_newsgroup.zip"):
  os.system('cp -p "/content/gdrive/MyDrive/Datasets/20_newsgroup.zip" "./"')
  if OS == "Linux":
    os.system('unzip -o -n "./20_newsgroup.zip" -d "./"')

print("Elapsed Time: ", timeit.default_timer() - start_time)

"""# All Controls"""

n_classes = 20
n_out = n_classes

"""# What is Glove?

GloVe is an unsupervised learning to build a word embeddings space of words, namely we get the vector representations for words. In order to train Glove we perform aggregated global word-word co-occurrence statistics from a corpus. The returned representations highlight interesting linear substructures of the word vector space.

The advantage of GloVe is that, unlike Word2vec, GloVe does not rely just on local statistics (local context information of words), but incorporates global statistics (word co-occurrence) to obtain word vectors.

You can derive semantic relationships between words from the co-occurrence matrix.

Given a corpus having V words, the co-occurrence matrix X will be a V x V matrix, where the i th row and j th column of X, X_ij denotes how many times word i has co-occurred with word j.

![man_woman.jpg](data:image/jpeg;base64,)

# Embeddings Matrix Load

First, build index mapping words in the embeddings set to their embedding vector
"""

print('Indexing word vectors.')

embeddings_index = {}
with open(os.path.join(embeddings_dir, 'glove.6B.200d.txt'), encoding = 'utf8') as f:
    for line in f:
        word, coefs = line.split(maxsplit=1)
        coefs = np.fromstring(coefs, 'f', sep=' ')
        embeddings_index[word] = coefs

print('Found %s word vectors.' % len(embeddings_index))

print(type(word))
print(type(coefs))
type(embeddings_index)
print(embeddings_index['start'])

"""# Dataset Preprocessing"""

print('Processing Benchmark Text dataset')

texts = []                      # list of text samples
labels_index = {}               # dictionary mapping label name to numeric id
labels = []                     # list of label ids
for name in sorted(os.listdir(text_benchmark_data_dir)):
    path = os.path.join(text_benchmark_data_dir, name)
    if os.path.isdir(path):     # if a directory exists
        label_id = len(labels_index)
        print(labels_index)
        labels_index[name] = label_id
        for fname in sorted(os.listdir(path)):
            if fname.isdigit():
                fpath = os.path.join(path, fname)
                args = {} if sys.version_info < (3,) else {'encoding': 'latin-1'}
                with open(fpath, **args) as f:
                    t = f.read()
                    i = t.find('\n\n')  # skip header
                    if 0 < i:
                        t = t[i:]
                    texts.append(t)
                labels.append(label_id)

print('Found %s texts.' % len(texts))

"""# Word Index Creation

Finally, vectorize the text samples into a 2D integer tensor
"""

tokenizer = Tokenizer(num_words=max_num_words)
tokenizer.fit_on_texts(texts)
sequences = tokenizer.texts_to_sequences(texts)

word_index = tokenizer.word_index
print('Found %s unique tokens.' % len(word_index))

print(type(texts[0]))
print(len(sequences))
print(sequences[0])
print(type(word_index))
print(word_index['news'])
print(word_index.items())
print(texts[0])

"""# Data Padding and One-Hot Encoding of Labels Outputs"""

data = pad_sequences(sequences, maxlen=max_sequence_length)

if n_out >= 2: 
  labels = to_categorical(np.asarray(labels))
else: 
  labels = np.asarray(labels)
  
print('Shape of data tensor:', data.shape)
print('Shape of label tensor:', labels.shape)

print(data[1])
print(labels)

"""# Shuffling of Datasets and Train and Validation Sets Preparation

split the data into a training set and a validation set
"""

indices = np.arange(data.shape[0])
np.random.shuffle(indices)
data = data[indices]
labels = labels[indices]
num_validation_samples = int(validation_split * data.shape[0])

x_train = data[:-num_validation_samples]
y_train = labels[:-num_validation_samples]
x_val = data[-num_validation_samples:]
y_val = labels[-num_validation_samples:]

print(x_train.shape)
print(y_train.shape)
print(x_val.shape)
print(y_val.shape)

print(y_train)
print(y_val)

"""# Embeddings Matrix Creation """

print('Preparing embedding matrix.')

# prepare embedding matrix
num_words = min(max_num_words, len(word_index)) + 1
embedding_matrix = np.zeros((num_words, embedding_dim))
for word, i in word_index.items():
    if i > max_num_words:
        continue
    embedding_vector = embeddings_index.get(word)
    if embedding_vector is not None:
        # words not found in embedding index will be all-zeros.
        embedding_matrix[i] = embedding_vector

embedding_matrix.shape

"""# Definition of the Embedding Layer

load pre-trained word embeddings into an Embedding layer
note that we set trainable = False so as to keep the embeddings fixed
"""

embedding_layer = Embedding(num_words, embedding_dim, embeddings_initializer=Constant(embedding_matrix), input_length=max_sequence_length, trainable=False)

"""# Model Definition

train a 1D convnet with global maxpooling
"""

sequence_input = Input(shape=(max_sequence_length,), dtype='int32')
embedded_sequences = embedding_layer(sequence_input)
x = Conv1D(128, 5, activation='relu')(embedded_sequences)
x = MaxPooling1D(5)(x)
x = Conv1D(128, 5, activation='relu')(x)
x = MaxPooling1D(5)(x)
x = Conv1D(128, 5, activation='relu')(x)
x = GlobalMaxPooling1D()(x)
x = Dense(128, activation='relu')(x)
preds = Dense(n_out, activation='softmax')(x)

model = Model(sequence_input, preds)
model.summary()

"""# Model Compiling and Fitting """

model.compile(loss=loss_func, optimizer='rmsprop', metrics=['acc'])

model.fit(x_train, y_train, batch_size=128, epochs=10, validation_data=(x_val, y_val))

